  false,\n\t\"url\": null,\n\t\"notes\": \"This digital ortho-imagery dataset is a
  survey of coastal California. The project area consists of approximately 3774 square
  miles. The project design of the digital ortho-imagery data acquisition was developed
  to achieve a 30 cm pixel resolution. Fugro EarthData, Inc. acquired 289 flight lines
  in 36 lifts from August 26, 2010 through November 29, 2010. Digital ortho-imagery
  data collection was performed with Conquest and King Air aircrafts, utilizing a
  Leica ADS40-SH52 sensor. During the time of image acquisition at least two dual
  frequency GPS receivers are utilized. One receiver, acting as the remote, was operated
  on board the aircraft with the antenna located over the camera. For differential
  GPS processing, a second receiver was used on land as the base station. These receivers
  were in constant operation during the imagery collection and GPS phase data was
  collected at an epoch rate of at least 1 second. After processing the differential
  GPS solution by using the remote and master station a final estimated trajectory
  is generated. The smoothed best estimate trajectory, or sbet, is then in combination
  with ground surveyed points to strengthen the geospatial accuracy of the imagery.
  The digital ortho-imagery was cut to tiles measuring 1500 meters by 1500 meters.\",\n\t\"owner_org\":
